  // Use useState to manage the state
  const [input, setInput] = useState("");

  // Event handler for input change
  const onInputChange = (event) => {
    console.log(event.target.value); // Handle the input change here
    setInput(event.target.value); // Update state (if needed)
  };

  const onButtonSubmit = () => {
    console.log("click");
  }

  return (
    <div className="App">
    <ParticlesBg className="particles"
        type="cobweb"
        color="#ffffff"
        num={300}
        bg={true}
      ></ParticlesBg>
    <Navigation/>
    <Logo/>
    <Rank/>
    <ImageLinkForm 
    onInputChange={onInputChange} onButtonSubmit={onButtonSubmit} />
    </div>
  );
}

export default App;
